import './App.css';
import {Route,Switch,BrowserRouter} from "react-router-dom";
import Home from "./components/Home"
import LandingPage from "./components/LandingPage";

function App() {
  return (
    <div>
      <Route exact path={"/"}>
      <LandingPage/>
      </Route>
        <Home/>
    </div>
  );
}

export default App;
